INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (450, 'shows', 'UPDATE', NULL, '{"id": 420, "date": "2023-01-01", "title": "Untitled Kristen Bell Project", "active": true, "studios": [1], "tmdb_id": null, "genre_id": 3, "status_id": 4, "studio_id": 1, "subgenres": [], "created_at": "2025-04-08T15:37:23.253571+00:00", "network_id": 14, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": null, "search_title": "untitled kristen bell project", "episode_count": null, "order_type_id": null, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (54, 'shows', 'UPDATE', NULL, '{"id": 1, "date": "2023-01-01", "title": "6666", "active": true, "studios": [14, 29], "tmdb_id": 279977, "genre_id": null, "status_id": 4, "studio_id": 14, "subgenres": [], "created_at": "2025-04-08T15:37:23.006588+00:00", "network_id": 15, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Founded when Comanches still ruled West Texas, no ranch in America is more steeped in the history of the West than the 6666. Still operating as it did two centuries before, and encompassing an entire county, the 6666 is where the rule of law and the laws of nature merge in a place where the most dangerous thing one does is the next thing. The 6666 is synonymous with the merciless endeavor to raise the finest horses and livestock in the world, and ultimately, where world class cowboys are born and made.", "search_title": "6666", "episode_count": 1, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (55, 'shows', 'UPDATE', NULL, '{"id": 2, "date": "2021-01-01", "title": "3 Body Problem", "active": true, "studios": [567, 8], "tmdb_id": 108545, "genre_id": 12, "status_id": 1, "studio_id": 567, "subgenres": [9, 6, 12], "created_at": "2025-04-08T15:37:23.007384+00:00", "network_id": 14, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Across continents and decades, five brilliant friends make earth-shattering discoveries as the laws of science unravel and an existential threat emerges.", "search_title": "3 body problem", "episode_count": 8, "order_type_id": 2, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (56, 'shows', 'UPDATE', NULL, '{"id": 3, "date": "2023-01-01", "title": "61st Street", "active": true, "studios": [37], "tmdb_id": 98657, "genre_id": 6, "status_id": 1, "studio_id": 37, "subgenres": [4], "created_at": "2025-04-08T15:37:23.008108+00:00", "network_id": 2, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Moses Johnson is a promising high-school athlete with a bright future who’s accused of murdering a police officer during a drug bust gone wrong. Swept up into the infamously corrupt Chicago criminal justice system, Moses’ case is taken up by ageing public defender Franklin Roberts, who sees this as his chance to finally challenge the institutional racism at the heart of the judicial system.", "search_title": "61st street", "episode_count": 8, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (57, 'shows', 'UPDATE', NULL, '{"id": 5, "date": "2023-01-01", "title": "A Knight of the Seven Kingdoms: The Hedge Knight", "active": true, "studios": [23], "tmdb_id": 224372, "genre_id": 6, "status_id": 4, "studio_id": 23, "subgenres": [12], "created_at": "2025-04-08T15:37:23.009627+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Set in an age when the Targaryen line still holds the Iron Throne and the memory of the last dragon has not yet passed from living memory, great destinies, powerful foes and dangerous exploits all await these improbable and incomparable friends.", "search_title": "a knight of the seven kingdoms: the hedge knight", "episode_count": 3, "order_type_id": 1, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (58, 'shows', 'UPDATE', NULL, '{"id": 6, "date": "2021-01-01", "title": "A League of Their Own", "active": true, "studios": [41], "tmdb_id": 107005, "genre_id": 3, "status_id": 3, "studio_id": 41, "subgenres": [6], "created_at": "2025-04-08T15:37:23.010301+00:00", "network_id": 17, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "In 1943, Carson Shaw travels to Chicago to try out for the All-American Girls Professional Baseball League. There, she meets other women who also dream of playing pro baseball and makes connections that open up her world. Rockford local Max Chapman also comes to the tryouts but is turned away. With the support of her best friend Clance, she must forge a new path to pursue her dream.", "search_title": "a league of their own", "episode_count": 8, "order_type_id": 1, "source_type_id": 7}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (59, 'shows', 'UPDATE', NULL, '{"id": 7, "date": "2023-01-01", "title": "A Man in Full", "active": true, "studios": [8], "tmdb_id": 225120, "genre_id": 6, "status_id": 2, "studio_id": 8, "subgenres": [], "created_at": "2025-04-08T15:37:23.010969+00:00", "network_id": 14, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Facing relentless foes and sudden bankruptcy, an Atlanta real estate tycoon must claw his way back to the top when his empire begins to crumble.", "search_title": "a man in full", "episode_count": 6, "order_type_id": 1, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (60, 'shows', 'UPDATE', NULL, '{"id": 8, "date": "2023-01-01", "title": "A Small Light", "active": true, "studios": [2, 55], "tmdb_id": 157160, "genre_id": 6, "status_id": 2, "studio_id": 2, "subgenres": [15], "created_at": "2025-04-08T15:37:23.011645+00:00", "network_id": 7, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Twentysomething Miep Gies didn''t hesitate when her boss Otto Frank came to her and asked her to hide his family from the Nazis during World War II. For the next two years, Miep, her husband Jan, and the other helpers watched over the eight souls in hiding in the Secret Annex. And it was Miep who found Anne’s Diary and kept it safe so Otto, the only one of the eight who survived, could later share it with the world as one of the most powerful accounts of the Holocaust.", "search_title": "a small light", "episode_count": 8, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
