INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (72, 'shows', 'UPDATE', NULL, '{"id": 21, "date": "2022-07-26", "title": "Animal Control", "active": true, "studios": [43], "tmdb_id": 214162, "genre_id": 3, "status_id": 1, "studio_id": 43, "subgenres": [], "created_at": "2025-04-08T15:37:23.020104+00:00", "network_id": 9, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "A group of local animal control workers'' lives are complicated by the fact that animals are simple, but humans are not. Leading the crew is Frank, an opinionated, eccentric animal control officer who may not have gone to college but is still the most well-read person in the room. In his past life as a cop, Frank tried to expose corruption in his department, but his efforts got him fired, leaving him cynical and curmudgeonly. Despite his rough exterior, he is blessed with an almost superhuman ability to understand animals.", "search_title": "animal control", "episode_count": 12, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
