INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (76, 'shows', 'UPDATE', NULL, '{"id": 25, "date": "2021-01-01", "title": "Anon Pls", "active": true, "studios": [572, 7], "tmdb_id": null, "genre_id": 6, "status_id": 4, "studio_id": 572, "subgenres": [], "created_at": "2025-04-08T15:37:23.022414+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "When Cricket Lopez, assistant to one of the most notorious celebrity stylists, revamps her old-style Instagram account and turns it into a celebrity gossip blog on a drunken whim, she never thinks it will become anything. But when the account grows overnight and she starts getting juicy gossip from fans, she becomes famous. No one knows that she is behind the account, but its newfound success is affecting her real life. Is the fame, the insider access and escape from real life really worth losing everything she has? Based on the novel by DeuxMoi.", "search_title": "anon pls", "episode_count": null, "order_type_id": null, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
