INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (123, 'shows', 'UPDATE', NULL, '{"id": 76, "date": "2023-01-01", "title": "Demascus", "active": true, "studios": [37], "tmdb_id": 222026, "genre_id": 3, "status_id": 1, "studio_id": 37, "subgenres": [6, 12], "created_at": "2025-04-08T15:37:23.052638+00:00", "network_id": 2, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "We meet Demascus in a moment of great inner strife. He''s just turned 33 (\"It''s my Jesus Year. My year to be a martyr.\"), and he''s suffering from arrested grief after the death of his mother. Plus the current state of the world has him feeling a bit out of step. Up is down. Black is white. The truth is nebulous. His career, his love life (or lack thereof), his identity is all up for debate. Quarter life crisis? Existential breakdown? Black man dual conscious paradox? Whatever you wanna call it, it has our protagonist with hella questions and very few answers.", "search_title": "demascus", "episode_count": 6, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
