INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (129, 'shows', 'UPDATE', NULL, '{"id": 82, "date": "2021-01-01", "title": "DMZ", "active": true, "studios": [593, 7], "tmdb_id": 113566, "genre_id": 6, "status_id": 2, "studio_id": 593, "subgenres": [12], "created_at": "2025-04-08T15:37:23.056202+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "In the near future after a bitter civil war leaves Manhattan a demilitarized zone (DMZ), destroyed and isolated from the rest of the world, fierce medic Alma Ortega sets out on a harrowing journey to find the son she lost in the evacuation of New York City at the onset of the conflict. Standing in her way are gangs, militias, demagogues and warlords, including Parco Delgado, the popular — and deadly — leader of one of the most powerful gangs in the DMZ.", "search_title": "dmz", "episode_count": 4, "order_type_id": 1, "source_type_id": 4}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (130, 'shows', 'UPDATE', NULL, '{"id": 83, "date": "2023-04-03", "title": "Doc", "active": true, "studios": [41], "tmdb_id": 255055, "genre_id": 6, "status_id": 1, "studio_id": 41, "subgenres": [], "created_at": "2025-04-08T15:37:23.05677+00:00", "network_id": 9, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Dr. Amy Larsen must navigate an unfamiliar world after a brain injury erases the last eight years of her life. She can rely only on her estranged 17-year-old daughter, whom she remembers as a 9-year-old, and a handful of devoted friends, as she struggles to continue practicing medicine, despite having lost nearly a decade of knowledge and experience.", "search_title": "doc", "episode_count": 10, "order_type_id": 2, "source_type_id": 14}', 'postgres', '2025-04-09 20:53:28.735677+00');
