INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (184, 'shows', 'UPDATE', NULL, '{"id": 143, "date": "2021-01-01", "title": "House of the Dragon", "active": true, "studios": [23], "tmdb_id": 94997, "genre_id": 12, "status_id": 1, "studio_id": 23, "subgenres": [6, 1], "created_at": "2025-04-08T15:37:23.094614+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "The Targaryen dynasty is at the absolute apex of its power, with more than 15 dragons under their yoke. Most empires crumble from such heights. In the case of the Targaryens, their slow fall begins when King Viserys breaks with a century of tradition by naming his daughter Rhaenyra heir to the Iron Throne. But when Viserys later fathers a son, the court is shocked when Rhaenyra retains her status as his heir, and seeds of division sow friction across the realm.", "search_title": "house of the dragon", "episode_count": 10, "order_type_id": 2, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (185, 'shows', 'UPDATE', NULL, '{"id": 144, "date": "2021-04-21", "title": "How I Met Your Father", "active": true, "studios": [1], "tmdb_id": 124010, "genre_id": 3, "status_id": 3, "studio_id": 1, "subgenres": [6], "created_at": "2025-04-08T15:37:23.095188+00:00", "network_id": 12, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "In the near future, Sophie tells her son the story of how she met his father: a story that catapults us back to the year 2021 where Sophie and her close-knit group of friends are in the midst of figuring out who they are, what they want out of life, and how to fall in love in the age of dating apps and limitless options.", "search_title": "how i met your father", "episode_count": 10, "order_type_id": 2, "source_type_id": 8}', 'postgres', '2025-04-09 20:53:28.735677+00');
