INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (187, 'shows', 'UPDATE', NULL, '{"id": 146, "date": "2023-01-01", "title": "How to Die Alone", "active": true, "studios": [591], "tmdb_id": 258582, "genre_id": 3, "status_id": 3, "studio_id": 591, "subgenres": [], "created_at": "2025-04-08T15:37:23.09634+00:00", "network_id": 12, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Mel is a broke, fat, Black JFK airport employee who''s never been in love and forgotten how to dream, until an accidental brush with death catapults her on a journey to finally take flight and start living by any means necessary.", "search_title": "how to die alone", "episode_count": 8, "order_type_id": 1, "source_type_id": 4}', 'postgres', '2025-04-09 20:53:28.735677+00');
