INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (236, 'shows', 'UPDATE', NULL, '{"id": 198, "date": "2021-01-01", "title": "Monsterland", "active": true, "studios": [52], "tmdb_id": 107119, "genre_id": 12, "status_id": 2, "studio_id": 52, "subgenres": [6, 9], "created_at": "2025-04-08T15:37:23.126473+00:00", "network_id": 12, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "In this fantasy anthology series, encounters with mermaids, fallen angels and other strange beasts drive broken people to desperate acts in an attempt to repair their lives, ultimately showing there is a thin line between man and beast.", "search_title": "monsterland", "episode_count": 8, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (237, 'shows', 'UPDATE', NULL, '{"id": 199, "date": "2023-01-01", "title": "Moon Knight", "active": true, "studios": [6], "tmdb_id": 92749, "genre_id": 12, "status_id": 2, "studio_id": 6, "subgenres": [9, 1], "created_at": "2025-04-08T15:37:23.127037+00:00", "network_id": 7, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "When Steven Grant, a mild-mannered gift-shop employee, becomes plagued with blackouts and memories of another life, he discovers he has dissociative identity disorder and shares a body with mercenary Marc Spector. As Steven/Marc’s enemies converge upon them, they must navigate their complex identities while thrust into a deadly mystery among the powerful gods of Egypt.", "search_title": "moon knight", "episode_count": 6, "order_type_id": 1, "source_type_id": 4}', 'postgres', '2025-04-09 20:53:28.735677+00');
