INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (334, 'shows', 'UPDATE', NULL, '{"id": 301, "date": "2021-02-09", "title": "The 4400", "active": true, "studios": [31], "tmdb_id": 127581, "genre_id": 6, "status_id": 3, "studio_id": 31, "subgenres": [12], "created_at": "2025-04-08T15:37:23.185331+00:00", "network_id": 23, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "4400 overlooked, undervalued, or otherwise marginalized people who vanished without a trace over the last hundred years are all returned in an instant, having not aged a day and with no memory of what happened to them. As the government races to analyze the potential threat and contain the story, the 4400 themselves must grapple with the fact that they''ve been returned with a few \"upgrades\", and the increasing likelihood that they were all brought back now for a specific reason.", "search_title": "the 4400", "episode_count": 13, "order_type_id": 1, "source_type_id": 8}', 'postgres', '2025-04-09 20:53:28.735677+00');
