INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (364, 'shows', 'UPDATE', NULL, '{"id": 332, "date": "2021-01-01", "title": "The Flight Attendant", "active": true, "studios": [7, 572, 651, 652], "tmdb_id": 93287, "genre_id": 6, "status_id": 3, "studio_id": 7, "subgenres": [9, 3], "created_at": "2025-04-08T15:37:23.203024+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Flight attendant Cassandra Bowden wakes in her hotel room hungover from the night before in Dubai with a dead body lying next to her. Afraid to call the police, she continues her morning as if nothing happened. In New York, she is met by FBI agents who question her about her recent layover in Bangkok. Still unable to piece the night together, she begins to wonder if she could be the killer.", "search_title": "the flight attendant", "episode_count": 8, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (365, 'shows', 'UPDATE', NULL, '{"id": 333, "date": "2023-01-01", "title": "The Franchise", "active": true, "studios": [7], "tmdb_id": 216619, "genre_id": 3, "status_id": 3, "studio_id": 7, "subgenres": [], "created_at": "2025-04-08T15:37:23.203584+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "The crew of an unloved franchise movie fight for their place in a savage and unruly cinematic universe. The series shines a light on the secret chaos inside the world of superhero moviemaking, to ask the question — how exactly does the cinematic sausage get made? Because every f*ck-up has an origin story.", "search_title": "the franchise", "episode_count": 8, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
