INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (367, 'shows', 'UPDATE', NULL, '{"id": 335, "date": "2021-01-01", "title": "The Gilded Age", "active": true, "studios": [23], "tmdb_id": 81723, "genre_id": 6, "status_id": 1, "studio_id": 23, "subgenres": [], "created_at": "2025-04-08T15:37:23.204698+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "It’s 1882 and the Gilded Age is in full swing when Marian Brook, a young orphaned daughter of a Southern general, moves in with her rigidly conventional aunts in New York City. With the help of Peggy Scott, an African-American woman masquerading as her maid, Marian gets caught up in the dazzling lives of her rich neighbors as she struggles to decide between adhering to the rules or forging her own path.", "search_title": "the gilded age", "episode_count": 9, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
