INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (378, 'shows', 'UPDATE', NULL, '{"id": 346, "date": "2023-01-01", "title": "The Mighty Ducks: Game Changers", "active": true, "studios": [2], "tmdb_id": 114621, "genre_id": 7, "status_id": 3, "studio_id": 2, "subgenres": [3], "created_at": "2025-04-08T15:37:23.210952+00:00", "network_id": 7, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "In present day Minnesota, the Mighty Ducks have evolved from scrappy underdogs to an ultra-competitive, powerhouse youth hockey team. After 12-year-old Evan is unceremoniously cut from the Ducks, he and his mom Alex set out to build their own ragtag team of misfits to challenge the cutthroat, win-at-all-costs culture of competitive youth sports.", "search_title": "the mighty ducks: game changers", "episode_count": 10, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
