INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (380, 'shows', 'UPDATE', NULL, '{"id": 348, "date": "2022-03-07", "title": "The Muppets Mayhem", "active": true, "studios": [2], "tmdb_id": 194573, "genre_id": 3, "status_id": 3, "studio_id": 2, "subgenres": [7], "created_at": "2025-04-08T15:37:23.212076+00:00", "network_id": 7, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "The Electric Mayhem Band goes on an epic musical journey to finally record their first studio album. With the help of a driven young music executive, Nora, the old-school Muppet band comes face to face with the current day music scene as they try to finally go platinum.", "search_title": "the muppets mayhem", "episode_count": 10, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (381, 'shows', 'UPDATE', NULL, '{"id": 349, "date": "2023-01-01", "title": "The Mysterious Benedict Society", "active": true, "studios": [654, 1, 620], "tmdb_id": 104359, "genre_id": 7, "status_id": 2, "studio_id": 654, "subgenres": [1, 6], "created_at": "2025-04-08T15:37:23.212646+00:00", "network_id": 7, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Four gifted orphans are recruited by an eccentric benefactor to go on a secret mission. Placed undercover at a boarding school known as The Institute, they must foil a nefarious plot with global ramifications, while creating a new sort of family along the way.", "search_title": "the mysterious benedict society", "episode_count": 8, "order_type_id": 2, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (382, 'shows', 'UPDATE', NULL, '{"id": 350, "date": "2021-01-01", "title": "The Nevers", "active": true, "studios": [23], "tmdb_id": 80828, "genre_id": 12, "status_id": 3, "studio_id": 23, "subgenres": [6], "created_at": "2025-04-08T15:37:23.213227+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "In the last years of Victoria''s reign, London is beset by the \"Touched\": people — mostly women — who suddenly manifest abnormal abilities, some charming, some very disturbing. Among them are Amalia True, a mysterious, quick-fisted widow, and Penance Adair, a brilliant young inventor. They are the champions of this new underclass, making a home for the Touched, while fighting the forces of… well, pretty much all the forces — to make room for those whom history as we know it has no place.", "search_title": "the nevers", "episode_count": 6, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (383, 'shows', 'UPDATE', NULL, '{"id": 351, "date": "2023-01-01", "title": "The Night Agent", "active": true, "studios": [41], "tmdb_id": 129552, "genre_id": 1, "status_id": 1, "studio_id": 41, "subgenres": [6, 9], "created_at": "2025-04-08T15:37:23.213809+00:00", "network_id": 14, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Brought together by a midnight phone call, an FBI agent and a cybersecurity expert must unravel an ever-growing web of political conspiracies.", "search_title": "the night agent", "episode_count": 10, "order_type_id": 2, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (384, 'shows', 'UPDATE', NULL, '{"id": 352, "date": "2021-01-01", "title": "The Old Man", "active": true, "studios": [569, 655], "tmdb_id": 111800, "genre_id": 1, "status_id": 3, "studio_id": 569, "subgenres": [6], "created_at": "2025-04-08T15:37:23.214372+00:00", "network_id": 12, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Dan Chase absconded from the CIA decades ago and now lives off the grid. When an assassin arrives and tries to take Chase out, the old operative learns that to ensure his future he now must reconcile his past.", "search_title": "the old man", "episode_count": 7, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (385, 'shows', 'UPDATE', NULL, '{"id": 353, "date": "2021-01-01", "title": "The One", "active": true, "studios": [656], "tmdb_id": 119284, "genre_id": 4, "status_id": 2, "studio_id": 656, "subgenres": [6, 12], "created_at": "2025-04-08T15:37:23.214933+00:00", "network_id": 14, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Love — and lies — spiral when a DNA researcher helps discover a way to find the perfect partner, and creates a bold new matchmaking service.", "search_title": "the one", "episode_count": 8, "order_type_id": 1, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (386, 'shows', 'UPDATE', NULL, '{"id": 354, "date": "2023-01-01", "title": "The Other Black Girl", "active": true, "studios": [591], "tmdb_id": 209727, "genre_id": 6, "status_id": 3, "studio_id": 591, "subgenres": [3], "created_at": "2025-04-08T15:37:23.2155+00:00", "network_id": 12, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Nella, an editorial assistant, is tired of being the only black girl at her company, so she’s excited when Hazel is hired. But as Hazel’s star begins to rise, Nella spirals out and discovers something sinister is going on at the company.", "search_title": "the other black girl", "episode_count": 10, "order_type_id": 1, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (387, 'shows', 'UPDATE', NULL, '{"id": 355, "date": "2021-01-01", "title": "The Outlaws", "active": true, "studios": [9], "tmdb_id": 136044, "genre_id": 3, "status_id": 2, "studio_id": 9, "subgenres": [4, 6], "created_at": "2025-04-08T15:37:23.216062+00:00", "network_id": 17, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Seven strangers from different walks of life - people who would never normally interact - are forced to work together to renovate a derelict community centre. They resent the menial physical labour and they resent each other. But when one of their number gets dragged into a dangerous world of organised crime, they unite in ways none of them thought possible.", "search_title": "the outlaws", "episode_count": 6, "order_type_id": 2, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (388, 'shows', 'UPDATE', NULL, '{"id": 356, "date": "2021-01-01", "title": "The Penguin", "active": true, "studios": [644, 657, 7], "tmdb_id": 194764, "genre_id": 6, "status_id": 2, "studio_id": 644, "subgenres": [4], "created_at": "2025-04-08T15:37:23.216625+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "With the city in peril following the seawall''s collapse, Oswald \"Oz\" Cobb seeks to fill the power vacuum left by the death of Carmine Falcone and finally give his mother Francis the life he''s always promised. But first, Oz must confront his enemies and his own demoralizing reputation as \"the Penguin.\"", "search_title": "the penguin", "episode_count": 8, "order_type_id": 1, "source_type_id": 4}', 'postgres', '2025-04-09 20:53:28.735677+00');
