INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (391, 'shows', 'UPDATE', NULL, '{"id": 359, "date": "2021-01-01", "title": "The Peripheral", "active": true, "studios": [9], "tmdb_id": 95403, "genre_id": 12, "status_id": 3, "studio_id": 9, "subgenres": [6], "created_at": "2025-04-08T15:37:23.218309+00:00", "network_id": 17, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Stuck in a small Appalachian town, a young woman’s only escape from the daily grind is playing advanced video games. She is such a good player that a company sends her a new video game system to test…but it has a surprise in store. It unlocks all of her dreams of finding a purpose, romance, and glamour in what seems like a game…but it also puts her and her family in real danger.", "search_title": "the peripheral", "episode_count": 8, "order_type_id": 1, "source_type_id": 2}', 'postgres', '2025-04-09 20:53:28.735677+00');
