INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (393, 'shows', 'UPDATE', NULL, '{"id": 361, "date": "2023-01-19", "title": "The Pradeeps of Pittsburgh", "active": true, "studios": [51], "tmdb_id": 243963, "genre_id": 3, "status_id": 3, "studio_id": 51, "subgenres": [6], "created_at": "2025-04-08T15:37:23.219465+00:00", "network_id": 17, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "The Pradeeps attempt to prove their innocence to a pair of investigating government agents by recounting their initial life in America after moving from India. Though each family member has a different perspective on the events, they weave together a story of humor, heartbreak, and the often-complicated pursuit of their respective American Dreams.", "search_title": "the pradeeps of pittsburgh", "episode_count": 8, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
