INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (471, 'shows', 'UPDATE', NULL, '{"id": 442, "date": "2021-01-01", "title": "We Own This City", "active": true, "studios": [669], "tmdb_id": 125949, "genre_id": 4, "status_id": 2, "studio_id": 669, "subgenres": [6], "created_at": "2025-04-08T15:37:23.266262+00:00", "network_id": 11, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "The story of the rise and fall of the Baltimore Police Department''s Gun Trace Task Force — and the corruption and moral collapse that befell an American city in which the policies of drug prohibition and mass arrest were championed at the expense of actual police work.", "search_title": "we own this city", "episode_count": 6, "order_type_id": 1, "source_type_id": 1}', 'postgres', '2025-04-09 20:53:28.735677+00');
