INSERT INTO audit.logs (id, table_name, operation, old_data, new_data, changed_by, created_at) VALUES (475, 'shows', 'UPDATE', NULL, '{"id": 446, "date": "2021-01-01", "title": "Wednesday", "active": true, "studios": [33], "tmdb_id": 119051, "genre_id": 12, "status_id": 1, "studio_id": 33, "subgenres": [9, 3], "created_at": "2025-04-08T15:37:23.268424+00:00", "network_id": 14, "updated_at": "2025-04-09T20:53:28.735677+00:00", "description": "Wednesday Addams is sent to Nevermore Academy, a bizarre boarding school where she attempts to master her psychic powers, stop a monstrous killing spree of the town citizens, and solve the supernatural mystery that affected her family 25 years ago — all while navigating her new relationships.", "search_title": "wednesday", "episode_count": 8, "order_type_id": 2, "source_type_id": 8}', 'postgres', '2025-04-09 20:53:28.735677+00');
