INSERT INTO public.shows (id, title, description, status_id, network_id, genre_id, subgenres, source_type_id, order_type_id, date, episode_count, tmdb_id, active, created_at, updated_at, studios) VALUES (3725, 'A League of Their Own', 'In 1943, Carson Shaw travels to Chicago to try out for the All-American Girls Professional Baseball League. There, she meets other women who also dream of playing pro baseball and makes connections that open up her world. Rockford local Max Chapman also comes to the tryouts but is turned away. With the support of her best friend Clance, she must forge a new path to pursue her dream.', 3, 17, 3, '{6}', 7, 1, '2021-01-01', 8, 107005, true, '2025-04-09 23:56:54.626236+00', '2025-04-10 06:20:04.322037+00', '{38}');
