INSERT INTO public.shows (id, title, description, status_id, network_id, genre_id, subgenres, source_type_id, order_type_id, date, episode_count, tmdb_id, active, created_at, updated_at, studios) VALUES (3727, 'A Small Light', 'Twentysomething Miep Gies didn''t hesitate when her boss Otto Frank came to her and asked her to hide his family from the Nazis during World War II. For the next two years, Miep, her husband Jan, and the other helpers watched over the eight souls in hiding in the Secret Annex. And it was Miep who found Anne’s Diary and kept it safe so Otto, the only one of the eight who survived, could later share it with the world as one of the most powerful accounts of the Holocaust.', 2, 7, 6, '{15}', 1, 1, '2023-01-01', 8, 157160, true, '2025-04-09 23:56:54.626236+00', '2025-04-10 06:20:04.322037+00', '{2,54}');
